import BlogList from "./BlogList";
import useFetch from "./useFetch";

const Travel = () => {
  const { error, isPending, data: travel } = useFetch('http://localhost:3000/travel');

  return (
    <div className="home">
      <h1 style={{ textAlign: 'center' }}> Travel</h1>
      {error && <div>{error}</div>}
      {isPending && <div>Loading...</div>}
      {travel && <BlogList blogs={travel} />}
    </div>
  );
}

export default Travel;
